//Contract based on [https://docs.openzeppelin.com/contracts/3.x/erc721](https://docs.openzeppelin.com/contracts/3.x/erc721)
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";

//Import for Chainlink VRF functionality
import "@chainlink/contracts/src/v0.8/VRFConsumerBase.sol";

contract NFTickets is ERC721URIStorage, VRFConsumerBase, Ownable {
    using Counters for Counters.Counter;

    struct eventStruct {
        bool isEvent;
        string eventName;
        uint ticketsMinted;
        uint maxCapacity;
        uint startingTokenID;
        address eventOwner;
        //currentTokenID will equal (ticketsMinted + startingID)
    }

    Counters.Counter private eventCount;

    // variable for mapping an event name with eventStruct details 
    mapping(uint256 => eventStruct) public events; 

    //mapping of ticket IDs to owner addresses
    mapping(uint256 => address) public ticketMap;

    bytes32 private keyHash;
    uint256 private fee;
    uint256 private randomNumber;

    event minted(address sender, uint256 tokenId);
    event eventInitialized(address owner, uint256 eventID);
    event winnersPicked (uint256 eventID, uint256[] winningTokenIDs);
    event winnersNotPicked (uint256 eventID);

    constructor() ERC721("NFTicket", "NFT") VRFConsumerBase(
            0x8C7382F9D8f56b33781fE506E897a4F1e2d17255, // VRF Coordinator
            0x326C977E6efc84E512bB9C30f76E30c160eD06FB  // LINK Token
        ) public
    {
        keyHash = 0x6e75b569a01ef56d18cab6a8e71e6600d6ce853834d4a5748b720d06f878b3a4;
        fee = 0.0001 * 10 ** 18; // 0.0001 LINK
    }


    function initEvent(string memory eventName, uint maxCapacity) public
        returns (uint256)
    {
        //get the eventID of the previous event to extract its startingTokenID and maxCap
        uint256 startingID = 1;
        if ( eventCount.current() > 0 ) {
            startingID = events[eventCount.current()].startingTokenID +
                events[eventCount.current()].maxCapacity;
        }

        //increment eventCount to create the new eventID
        eventCount.increment();
        uint256 eventID = eventCount.current();

        //save new event to on-chain storage
        events[eventID] = eventStruct( {
            isEvent: true,
            eventName: eventName, 
            ticketsMinted: 0,
            maxCapacity: maxCapacity,
            startingTokenID: startingID,
            eventOwner: msg.sender
            } );

        // emit a confirmation,
        // includes the event ID which is needed to mint in the future
        emit eventInitialized(msg.sender, eventID);
        return eventID;
    }

    function mintNFT(uint256 eventID, string memory tokenURI) public 
        returns (uint256)
    {   
        uint256 tokenID = 0;
        if(events[eventID].isEvent == true) {

            if (events[eventID].ticketsMinted < events[eventID].maxCapacity ) {

                tokenID = events[eventID].startingTokenID + events[eventID].ticketsMinted;

                events[eventID].ticketsMinted += 1;
                ticketMap[tokenID] = msg.sender;

                _safeMint(msg.sender, tokenID);
                _setTokenURI(tokenID, tokenURI);

                // emit a confirmation,
                // include tokenID of new NFTicket
                emit minted(msg.sender, tokenID);
            }
        }

        return tokenID;
    }

    // Pick a number of winners from an event randomly, must be initialized via owner
    function pickWinners(uint256 eventID, uint256 numberOfWinners) public 
    {   
        if( msg.sender == events[eventID].eventOwner) {
            if (numberOfWinners > events[eventID].ticketsMinted) {
                numberOfWinners = events[eventID].ticketsMinted;
            }
            uint256[] memory winners;
            for(uint i = 0; i < numberOfWinners; i += 1) {
                getRandomNumber();
                uint256 randomWinner = events[eventID].startingTokenID + (randomNumber % events[eventID].maxCapacity);
                for(uint x = 0; x < winners.length; x += 1) {
                    if(winners[x] == randomWinner)
                    {
                        getRandomNumber();
                        randomWinner = events[eventID].startingTokenID + (randomNumber % events[eventID].maxCapacity);
                        x=0;
                    }
                }
                winners[i]=randomWinner;
            }

            // Do to let the winners know they've been chosen
            //console.log("List of %s winning token IDs", numberOfWinners);
            //for(uint i = 0; i < numberOfWinners; i += 1) {
            //    console.log(winners[i]);
            //}
            emit winnersPicked(eventID, winners);
        }
        else {
            emit winnersNotPicked(eventID);
        }

    }

    //Requests randomness 
    function getRandomNumber() public returns (bytes32 requestId) {
        require(LINK.balanceOf(address(this)) > fee, "Not enough LINK - fill contract with faucet");
        return requestRandomness(keyHash, fee);
    }

    //Callback function used by VRF Coordinator
    function fulfillRandomness(bytes32 requestId, uint256 randomness) internal override {
        //Save the result to the global variable defined above
        randomNumber = randomness;
    }
}

